import React from "react";
import Particles from "react-particles-js";
import { Container, Row, Col } from "react-grid-system";

class parts extends React.Component {
  render() {
    return (
      <div>
        <Particles
          height="100vh"
          style={{
            opacity: "0.8",
            position: "fixed",
            left: "0",
            top: "0"
          }}
          params={{
            particles: {
              number: {
                value: 50
              },
              move: {
                direction: "random",
                speed: 1
              },
              size: {
                value: 3
              }
            },
            interactivity: {
              events: {
                onhover: {
                  enable: true,
                  mode: "repulse"
                }
              }
            }
          }}
        />
        <div
          style={{
            position: "fixed",
            top: "0",
            left: "0",
            margin: "100px",
            zIndex: "1"
          }}
        >
          <Row height="100vh" justify="center" align="middle">
            <h1>hellos</h1>
          </Row>
        </div>
      </div>
    );
  }
}

export default parts;
